import React from "react";
import '../styles/snippets/Createboxpopup.css'
import { useEffect, useState } from "react";
import axios from 'axios'

function Createboxpopup(props) {

    const [click, setClick] = useState(false)

    const handleSubmit = () => {
        axios.post(`${process.env.REACT_APP_ROUTE}/api/brand/register`, {
            brand_name: brand,
            email: email,
            password: password,
        }).then((res) => {
            if (res.data.error) {
                setError(res.data.error)
            } else {
                signIn({
                    token: res.data.token,
                    expiresIn: 3600,
                    tokenType: "Bearer",
                    authState: res.data.user_profile,
                })
                navigate('/dashboard/brand/profile')
            }
        }).catch(err => console.log(err))
    }

    useEffect(() => {
        if (click) {
            props.stateChanger(false)
        }
    }, [click, props])

    return (
        <div onClick={() => setClick(!click)} className="createbox-container-overlay">
            <div onClick={(e) => (e.stopPropagation())} className="createbox-popup-modal">
                <form onSubmit={handleSubmit()}>
                    <h2 className="dashboardheader-title-text">Create Box</h2>
                    <div className='brand-landingpage-two-fields'>
                        <div className='brand-landingpage-field'>
                            <label htmlFor='brand-register-Label'>LABEL:</label>
                            <input required id='brand-register-Label' type="text" ></input>
                        </div>
                    </div>
                    <div className='brand-landingpage-two-fields'>
                        <div className='brand-landingpage-field'>
                            <label htmlFor='brand-register-description'>DESCRIPTION</label>
                            <textarea required rows="5" id='brand-register-description' type="text" ></textarea>
                        </div>
                    </div>
                    <div className="createbox-action-container">
                        <button onClick={() => setClick(!click)} className="affiliateprofile-button-two">Cancel</button>
                        <button type="submit" className="affiliateprofile-button-three">Create</button>
                    </div>
                </form>
            </div>
        </div>
    )
}

export default Createboxpopup
